import React, { Component } from "react";
import { Navbar, Table, InputGroup, FormControl } from "react-bootstrap";
import UserConsumer from "../context";
class BottomAdd extends Component {
  render() {
    return (
      <UserConsumer>
        {(value) => {
          return (
            <Navbar className="fixed-bottom">
              <Table>
                <thead>
                  <tr>
                    <td>ID</td>
                    <td>Name</td>
                    <td>Job</td>
                    <td>Salary</td>
                  </tr>
                </thead>
                <tbody>
                  <tr>
                    <td></td>
                    <td>
                      <InputGroup className="mb-3">
                        <FormControl
                          placeholder="Username"
                          aria-label="Username"
                          aria-describedby="basic-addon1"
                        />
                      </InputGroup>
                    </td>
                    <td></td>
                    <td></td>
                  </tr>
                </tbody>
              </Table>
            </Navbar>
          );
        }}
      </UserConsumer>
    );
  }
}
export default BottomAdd;
